import React from 'react';
import '../App.css';

const Header = () => {
	return (
		<header className="header">
			<div className='content'>
				<div className= "logo">
					<h1>Chien Huang</h1>
				</div>
				<nav>
					<ul className='nav-links'>
						<li><a href="#about">About Me</a></li>
						<li><a href="#reflection">WIL Reflection</a></li>
						<li><a href="#skills">Technical Skill</a></li>
						<li><a href="#ethic">Ethics & Accountability</a></li>
						<li><a href="artefact">Additional Artefact</a></li>
						<li><a href="contact">Contact Me</a></li>
					</ul>
				</nav>
				<div className='social-links'>
					<a href='https://github.com/ChienHuang0818'>GitHub</a>
					<a href='https://linkedin.com/in/chien-huang-sarah'>LinkedIn</a>
				</div>
			</div>	
		</header>		
	);	
};

export default Header;
